        function sleepMs(ms) {

        function isRetryableStatus(statusCode) {
            return statusCode === 408 || statusCode === 425 || statusCode === 429 || statusCode === 500 || statusCode === 502 || statusCode === 503 || statusCode === 504;

        function fetchJsonWithRetry(url, maxAttempts, baseDelayMs) {
            maxAttempts = Math.max(1, maxAttempts || 1);
            baseDelayMs = Math.max(100, baseDelayMs || 0);
            return (async function() {
                for (var attempt = 0; attempt < maxAttempts; attempt++) {
                    try {
                        var r = await fetch(url, { cache: 'no-store', mode: 'cors' });
                        if (r && r.ok) {
                            var t = await r.text();
                            try { return JSON.parse(t); } catch (e) {}
                        } else if (r && !isRetryableStatus(r.status)) {
                            // Hard errors (e.g. 400/404) should not consume all retries.
                            return null;
                        }
                    } catch (e) {}
                    if (attempt + 1 < maxAttempts) {
                        await sleepMs(baseDelayMs * (attempt + 1));
                    }

                return null;
            })();
        }

        var rasterServerReadyPromise = null;

            rasterServerReadyPromise = fetchJsonWithRetry(healthUrl, 10, 600)
                .then(function(resp) {
                    if (resp && resp.status === 'ok') return true;
                    return false;
                })
                .catch(function() { return false; });
            return rasterServerReadyPromise;
        }

        function fetchTimeseries(folder, varName, dateCompact, latlng) {
            var url = rasterClickServerUrl + '/timeseries?folder=' + encodeURIComponent(folder) +
                      '&var=' + encodeURIComponent(varName) +
                      '&date=' + encodeURIComponent(dateCompact) +
                      '&lat=' + encodeURIComponent(latlng.lat) +
                      '&lng=' + encodeURIComponent(latlng.lng);
            return fetchJsonWithRetry(url, 6, 450);
        }
        function fetchTimeseriesAllDays(folder, varName, latlng) {
            var dates = timelineDatesUnique.length ? timelineDatesUnique : [currentDateCompact || ''];
            return (async function() {
                // Warm up sleeping free-tier backends before requesting each day.
                await ensureRasterServerReady();
                var series = [];
                var usedNearest = false;
                var offsets = [];
                var lengths = [];
                var labels = [];
                var hoursByDay = [];
                var cursor = 0;
                var dayPromises = dates.map(function(dc) {
                    if (!dc) return Promise.resolve(null);
                    return fetchTimeseries(folder, varName, dc, latlng);
                });
                var dayResps = await Promise.all(dayPromises);
                for (var i = 0; i < dates.length; i++) {
                    var dc = dates[i];
                    var expectedHours = dayHoursMap[dc] || [];
                    var expectedLen = expectedHours.length || 0;
                    var resp = dc ? dayResps[i] : null;
                    var vals = (resp && Array.isArray(resp.values)) ? resp.values.slice() : [];
                    if (resp && resp.used_nearest) usedNearest = true;
                    if (expectedLen > 0) {
                        if (vals.length < expectedLen) {
                            while (vals.length < expectedLen) vals.push(null);
                        } else if (vals.length > expectedLen) {
                            vals = vals.slice(0, expectedLen);
                        }
                    }
                    offsets.push(cursor);
                    lengths.push(vals.length);
                    labels.push(dc);
                    hoursByDay.push(expectedHours);
                    for (var j = 0; j < vals.length; j++) series.push(vals[j]);
                    cursor += vals.length;
                }
                if (!series.length) return null;
                var hasAny = series.some(function(v) { return v !== null && v !== undefined && !isNaN(v); });
                if (!hasAny) return null;
                return {
                    values: series,
                    used_nearest: usedNearest,
                    dayMeta: { offsets: offsets, lengths: lengths, labels: labels, hours: hoursByDay }
                };
            })();
        }

        function renderTimeseriesSvg(values, w, h, unit, bands, dayMeta, selectedIdx) {
            w = w || 430; h = h || 160;
            var multiDay = dayMeta && dayMeta.labels && dayMeta.labels.length > 1;
            var padL = 44, padR = 10, padT = multiDay ? 20 : 8, padB = 20;
            var plotW = w - padL - padR;
            var plotH = h - padT - padB;
            var all = [];
            values.forEach(function(v) { if (v !== null && v !== undefined && !isNaN(v)) all.push(v); });
            if (!all.length) return '';
            var minv = Math.min.apply(null, all);
            var maxv = Math.max.apply(null, all);
            if (minv === maxv) maxv = minv + 1e-6;
            var denom = (values.length > 1) ? (values.length - 1) : 1;
            function xForIndex(i) {
                return padL + (i / denom) * plotW;
            }
            var bandRects = '';
            if (bands && bands.length) {
                var bandsSorted = bands.slice().sort(function(a, b) {
                    var a0 = (a.range && a.range.length) ? a.range[0] : 0;
                    var b0 = (b.range && b.range.length) ? b.range[0] : 0;
                    return a0 - b0;
                });
                bandsSorted.forEach(function(b) {
                    var r0 = b.range ? b.range[0] : null;
                    var r1 = b.range ? b.range[1] : null;
                    if (r0 === null || r1 === null) return;
                    var c0 = Math.max(r0, minv);
                    var c1 = Math.min(r1, maxv);
                    if (!isFinite(c0) || !isFinite(c1)) return;
                    if (c1 <= minv || c0 >= maxv) return;
                    var y1 = padT + (1 - (c0 - minv) / (maxv - minv)) * plotH;
                    var y2 = padT + (1 - (c1 - minv) / (maxv - minv)) * plotH;
                    var yTop = Math.min(y1, y2);
                    var yH = Math.abs(y2 - y1);
                    bandRects += '<rect x="' + padL + '" y="' + yTop.toFixed(2) + '" width="' + plotW + '" height="' + yH.toFixed(2) + '" fill="' + (b.color || '#ccc') + '" opacity="0.25"/>';
                });
            }
            var svg = '<svg width="' + w + '" height="' + h + '" style="overflow:hidden;" xmlns="http://www.w3.org/2000/svg">';
            svg += '<rect x="0" y="0" width="' + w + '" height="' + h + '" fill="#fff" stroke="#eee"/>' + bandRects;
            svg += '<line x1="' + padL + '" y1="' + (padT + plotH) + '" x2="' + (padL + plotW) + '" y2="' + (padT + plotH) + '" stroke="#666" stroke-width="1"/>';
            svg += '<line x1="' + padL + '" y1="' + padT + '" x2="' + padL + '" y2="' + (padT + plotH) + '" stroke="#666" stroke-width="1"/>';
            var ticksY = 4;
            var ticksX = [];
            if (!multiDay) {

                if (hours && hours.length) {

                        var h = candidates[ci];
                        var idx = hours.indexOf(h);
                        if (idx >= 0) ticksX.push({ idx: idx, label: pad2(h) });

                    if (!ticksX.length) {

                    var lbl = labelDateCompact(dayMeta.labels[di] || '');
                    if (lbl) {

                            var metricName = activeHourly.var_name || activeHourly.name || 'Value';
